Now a major motion picture starring George Clooney! Matthew King was once considered one of the most fortunate men in Hawaii. His missionary ancestors who came to the islands were financially and culturally progressiveone even married a Hawaiian princess, making Matt a royal descendant and one of the states largest landowners. But now his luck has changed. His two daughters are out of control10-year-old Scottie has a smart-ass attitude and a desperate need for attention and 17-year-old Alex, a former model, is a recovering drug addict. His thrill-seeking and high-maintenance wife, Joanie, lies in a coma after a boat racing accident, and will soon be taken off life support. The King family can hardly picture life without their charismatic mother, but as they come to terms with this tragedy, their sadness is mixed with a sense of freedom that shames themand spurs them into surprising actions.

